const isMobileDevice = () => (typeof window.orientation !== 'undefined') || (navigator.userAgent.indexOf('IEMobile') !== -1);

const isElementChildOf = (item, parent) => !!($(item).parents(parent).length);

const addParallaxToHeader = (applyEffect) => {
  if (!applyEffect) return;

  const movingElement = $('[data-parallax="element"]');
  const container = {
    node: $('[data-parallax="container"]'),
    fixedHeight: null,
  }
  
  if (!container.node.length) return;
  if (!movingElement.length) return;

  container.node.children().each((_, item) => container.fixedHeight += $(item).outerHeight(true));
  container.node.css({
    'overflow': 'hidden',
    'height': container.fixedHeight,
  });

  $(window).scroll(function() {
    const distance = window.scrollY;
    const jobTabs = document.querySelector('.job-tabs-container');
    const jobCardOffsetHeight = document.querySelector('.job-card').offsetHeight;
    const jobTabsHeight = jobTabs.offsetHeight;

    container.node.css('transform', `translateY(${distance * 0.2}px)`);
    movingElement.css('transform', `translateY(${distance * 0.1}px)`);

    if (distance >= (jobCardOffsetHeight + jobTabsHeight)) {
      $(jobTabs).addClass('active-scroll');
    } else {
      $(jobTabs).removeClass('active-scroll');
    }

    (distance >= 274)
      ? $('html, body').addClass('scrolling')
      : $('html, body').removeClass('scrolling');
  });
}

const handleTabIndex = (showHide, arr) => {
  $.map(arr, function (item) {
    if (showHide !== 'show' && showHide !== 'hide') return;
    if (isElementChildOf(item, '.job-card')) {
      (showHide === 'show') ? $(item).attr('tabindex', 0) : $(item).attr('tabindex', -1);
    }
  });
};

const handleAsideBannerMargin = () => {
  const jobCard = document.querySelector('.job-card');
  const jobContent = document.querySelector('.job-aside');
  const jobInfoContainer = document.querySelector('.job-info__container');

  const setBannerMarginTop = () => {
    return jobContent.style.marginTop = `${jobCard.offsetHeight - jobInfoContainer.offsetHeight}px`;
  };

  if (isMobileDevice()) return;
  return (jobContent !== null) 
    ? setBannerMarginTop()
    : null;
};

const animateShareButtons = (showHide, elements, callback) => {
  if (showHide !== 'show' && showHide !== 'hide') return;
  if (showHide === 'show') {
    elements.css({
      opacity: '1',
      transform: 'translate(0,0)'
    });
  } else {
    elements.css({
      opacity: '0',
      transform: 'translate(100px,0)'
    });
  }
    if (typeof callback === 'function') setTimeout(() => callback(), 1000);
};

const shareDesktop = (el, text) => {
  try {
    el.text(text).addClass('is-active');
    setTimeout(() => el.text('').removeClass('is-active'), 4000);
    copyToClipboard(location.href);
  } catch(err) {
    console.warn('shareDesktop(): ' + err);
  }
};

const copyToClipboard = str => {
  const el = document.createElement('textarea');
  el.value = str;
  document.body.appendChild(el);
  el.select();
  document.execCommand('copy');
  document.body.removeChild(el);
};

const shareMobile = async () => {
  const shareData = {
    title: document.title,
    text: $('meta[name="description"]').attr('content'),
    url: location.href
  }
  try {
    await navigator.share(shareData);
  } catch(err) {
    console.warn('shareMobile(): ' + err);
  }
};

const addScrollEffect = (applyEffect) => {
  if (!applyEffect) return;

  const card = $('[data-animatescroll]');
  const translatePx = card.find('.job-card__expiration').outerHeight();

  card.css({transition: 'transform 1s ease'});
  
  $(window).scroll(function() {
    const distance = window.scrollY;
    if (distance > 60) {
      card.css({ transform: `translateY(calc(${translatePx}px + 16px))`});
      card.addClass('scrolled');
    }
    else {
      card.css({transform : `translateY(0px)`});
      card.removeClass('scrolled');
    }
  });
}
const handleJobIncompatibility = (applyEffect) => {
  if (!applyEffect) return;
  
  const incompatibilityWrapper = $('[data-incompatibility]');
  const overlay = $('.vg-page-mobile__overlay');
  const hasIncompatibility = incompatibilityWrapper.length;
  if (!hasIncompatibility) return;

  const button = incompatibilityWrapper.find('.job-incompatibility__button');
  const content = incompatibilityWrapper.find('.job-incompatibility__content');

  if (hasIncompatibility) overlay.addClass('is-visible');

  button.on('click', () => {
    content.toggleClass('is-visible');
    incompatibilityWrapper.toggleClass('is-expanded');
    overlay.toggleClass('is-visible')
  });

  overlay.on('click', () => {
    content.toggleClass('is-visible');
    incompatibilityWrapper.toggleClass('is-expanded');
    overlay.toggleClass('is-visible');
  });
}

const handleTabsContent = () => {
  const toggleBenefits = $('.toggle-benefits');
  const benefitsList = $('.job-benefits__list');
  const tabLinks = $('.job-group__tab-link');
  const showAllBenefits = $('.show-all-benefits');
  const jobContents = $('.job-tab-content');
  const headerHeight = $('#topo-candidato-logado').height();
  const jobTabsHeight= $('.job-group__tabs').height();
  let contentPosition = [];
  let topPosition = 0;

  const getContentsPosition = () => $.each(jobContents, (i) => {
    contentPosition.push(Math.abs($(jobContents[i]).offset().top) + $(jobContents[i]).height());
  });

  getContentsPosition();

  $(window).scroll(function() {
    topPosition = $(window).scrollTop() + headerHeight + jobTabsHeight;

    $.each(contentPosition, (i) => {
      if(topPosition <= parseInt(contentPosition[i])) {
        $('.job-group__tab-link.active').removeClass('active');
        $('.job-group__tab-link').eq(i).addClass('active');
        return false;
      }
    });
  });

  $.each(tabLinks, function(i){
    $(tabLinks[i]).click(function(e) {
      e.preventDefault();
      e.stopPropagation();

      if ($(this).attr('id').toString()) {
        $('html, body').animate({
          scrollTop: (i === 0) ? 0 : contentPosition[i - 1] - (headerHeight + 50),
        }, 500);
      }
    });
  });
  
  toggleBenefits.on('click', () => {
    benefitsList.toggleClass('show-less');
    toggleBenefits.toggleClass('active');
    showAllBenefits.toggleClass('active');
    contentPosition.length = 0;
    getContentsPosition();
  });
};

$(window).load(function() {
  const btnShareOpen = $('[data-shareopen]');
  const btnShareClose = $('[data-shareclose]');
  const btnShareUrl = $('[data-shareurl]');
  const shareNetworks = $('[data-sharenetworks]');
  const shareButtons = $('[data-network]');

  btnShareOpen.on('click', function() {
    const firstNetwork = shareNetworks.find('.st-first');
    const shareButtons = $('.job-card [data-network]');

    handleTabIndex('hide', [btnShareOpen]);
    handleTabIndex('show', [btnShareClose, ...shareButtons]);

    shareNetworks.addClass('is-visible');
    animateShareButtons('show', shareButtons, function() {
      firstNetwork.focus()
    });
  });

  btnShareClose.on('click', function() {
    const shareButtons = $('.job-card [data-network]');

    handleTabIndex('hide', [btnShareClose, ...shareButtons]);
    handleTabIndex('show', [btnShareOpen]);

    animateShareButtons('hide', shareButtons, function() {
      shareNetworks.removeClass('is-visible');
      btnShareOpen.focus();
    });
  });

  btnShareUrl.on('click', function(e) {
    e.preventDefault();

    const button = $(this);
    const buttonText = button.attr('data-text');

    (isMobileDevice()) ? shareMobile() : shareDesktop(button, buttonText);
  });

  handleTabIndex('hide', [btnShareClose, ...shareButtons]);

  shareButtons
    .css('transition', 'opacity 1s .25s, transform 1s .25s, width 1s')
    .each((_, item) => {
      if (isElementChildOf(item, '.job-card')) animateShareButtons('hide', $(item));
    });
});

$(function() {
  addParallaxToHeader(!isMobileDevice());
  addScrollEffect(isMobileDevice());
  handleJobIncompatibility(isMobileDevice());
  handleAsideBannerMargin();
  handleTabsContent();
});
var aplicar_locale = function (locale) {
  document.cookie = 'locale_js=' + locale + '; path=/';
  location.reload();
  return false;
};
