/**
* Controla o select de idiomas no footer
**/

(function($) {
  const selectLanguage = {
    init: function () {
      this.setup();
      this.bind();
      this.locale();
    },

    setup: function () {
      const that = this;
      that.$container = $('#listaIdiomas');
    },

    bind: function() {
      const that = this;
      $(window).on('click', { 'that': that }, that.hideOptions);

      that.$container.find('.dropdown-toggle').on('click', { 'that': that }, that.toggleOptions);
      that.$container.find('.dropdown-menu .dropdown-item').last().on('blur', { 'that': that }, that.hideOptions);
    },

    toggleOptions: function(e) {
      e.preventDefault();
      const that = e.data.that,
        windowBottom = $(window).scrollTop() + $(window).height(),
        optionsElementBottomOffset = $(this).offset().top + 100,
        shouldOpenUp = windowBottom < optionsElementBottomOffset;
        
      (shouldOpenUp) 
        ? that.$container.find('.dropdown-menu').addClass('up') 
        : that.$container.find('.dropdown-menu').removeClass('up');
      
      that.$container.addClass('show');
      that.$container.find('.dropdown-toggle').attr('aria-expanded', true);
      that.$container.find('.dropdown-menu .dropdown-item').first().focus();
      e.stopPropagation();
    },

    hideOptions: function(e) {
      const that = e.data.that;
      that.$container.removeClass('show');
      that.$container.find('.dropdown-toggle').attr('aria-expanded', false);
    },

    locale: function() {
      function changeLocale (locale) {
        document.cookie = `locale_js=${locale}; path=/`;
        window.location.reload();
        return false;
      };

      $('.item-locale').on('click', function(event) {
        event.preventDefault();
        const locale = $(this).attr('data-testid');
        changeLocale(locale);
      });
    },
  };

  selectLanguage.init();
})($);
/** Mdulo responsvel pelo menu quando o candidato est logado.
/* @Module utils/menuLogado */


define('utils/menuLogado', [], function () {
    var menu = {
        init: function () {
            var _self = this;

            this.load().done(function () {
                _self.bind();
            });
        },
        load: function () {
            // Buscamos as sees para utilizar posteriormente.
            var menuNotificacoes = $("#menu-notificacoes-holder"),
                defer = $.Deferred();

            if (!menuNotificacoes.length)
                return defer.resolve();

            // Carregando informaes do  menu de notificaes
            $.ajax({
                url: menuNotificacoes.data('url') + '.js',
                method: "GET",
                dataType: 'html',
                success: function (data) {
                    menuNotificacoes.html(data);
                    defer.resolve();
                },
                error: function(err) {
                    console.log(err);
                    defer.reject();
                }
            });
            return defer.promise();
        },
        bind: function () {
            var $menuNotificacoes = $("#menu-notificacoes");
            var $menuCandidatos = $("#menu-candidatos");
            $(document).on("click", function (e) {
                if (!jQuery.contains($menuCandidatos, e.target) &&
                    !$menuCandidatos.find(e.target).length) {
                    $("body, html").removeClass("menu-aberto");
                };
                if (!jQuery.contains($menuNotificacoes, e.target) &&
                    !$menuNotificacoes.find(e.target).length) {
                    if ($menuNotificacoes.is(":visible"))
                        $menuNotificacoes.removeClass("menu-aberto").hide();
                };
            });

            $("#menu-btn").bind("click", function (e) {
                e.preventDefault();
                e.stopPropagation();
                $menuCandidatos = $("#menu-candidatos");

                if ($menuCandidatos.hasClass('menu-dropdown')) {
                    $menuCandidatos.toggle();
                } else {
                    $("body, html").toggleClass("menu-aberto");
                }

                if ($(window).width() > 767 && $("#menu-notificacoes").is(":visible")) {
                    $menuNotificacoes.removeClass("menu-aberto");
                } else {
                    $("#servicos-miolo, #curriculo").removeAttr("style");
                    $("#headerHolder .menu-aberto").removeClass("menu-aberto");
                    $("#servicos-miolo").removeAttr("style");
                }
            });

            $("#menu-overlay").bind("click", function (e) {
                $("#headerHolder .menu-aberto").removeClass("menu-aberto");
                $("#servicos-miolo").removeAttr("style");
                $("body, html").toggleClass("menu-aberto");
            });

            $("#menu-fechar").bind("click", function (e) {
                $("#headerHolder .menu-aberto").removeClass("menu-aberto");
                $("#servicos-miolo").removeAttr("style");
                $("body, html").toggleClass("menu-aberto");
            });

            $("#menu-configuracoes a.mn-configuracoes").bind("click", function (e) {
                e.preventDefault();
                $(this).toggleClass("aberto");
                $("#submenu-configuracoes").slideToggle();
            });

            $("#notificacoes-btn").bind("click", function (e) {
                e.preventDefault();
                e.stopPropagation();

                if ($(window).width() > 767) {
                    if ($("#menu-candidatos").is(":visible")) {
                        $("body, html").removeClass("menu-aberto");
                    };
                    $("#menu-notificacoes").toggle();
                } else {
                    $("body, html").removeClass("menu-aberto");
                    $("#pesquisa-submenu").removeClass("menu-aberto");
                    $("#menu-notificacoes").toggleClass("menu-aberto");

                    if ($("#menu-notificacoes").hasClass("menu-aberto")) {
                        $("#servicos-miolo, #curriculo").css('margin-top', $("#menu-notificacoes").outerHeight() - 35);
                    } else {
                        $("#servicos-miolo, #curriculo").removeAttr("style");
                    }
                }
            });

            $(".btn-fechar-pesquisa").bind("click", function (e) {
                e.preventDefault();

                $("body, html, #menu-notificacoes, #pesquisa-submenu").removeClass("menu-aberto");
                $("#topo-candidato-logado").removeClass("vagas-search");
            });

            $("#btn-pesquisa").bind("click", function (e) {
                e.preventDefault();

                $("body, html, #menu-notificacoes").removeClass("menu-aberto");
                $("#pesquisa-submenu").toggleClass("menu-aberto");
                $("#topo-candidato-logado").addClass("vagas-search");
            });

            $(window).resize(function (e) {
                if ($(window).width() > 767) {
                    $(".menu-aberto").removeClass("menu-aberto");
                    $("#servicos-miolo, #curriculo").removeAttr("style");
                } else {
                    $("#menu-notificacoes").removeAttr("style");
                    var $menuCandidatos = $("#menu-candidatos");
                    if ($menuCandidatos.hasClass('menu-dropdown')) {
                        $menuCandidatos.removeAttr("style");
                    }
                }
            });
        }
    };

    return menu;
});
